@testset "Custom Func and Val for Mean" begin
    portfolio = Portfolio(; prices = prices)
    mu_opt = MuOpt(; method = :Custom_Func,
                   genfunc = GenericFunction(; func = x -> 3 * vec(mean(x; dims = 1))))
    asset_statistics!(portfolio; calc_kurt = false, mu_opt = mu_opt)
    mu1 = portfolio.mu

    mu_opt.method = :Custom_Val
    mu_opt.custom = 2 * vec(mean(portfolio.returns; dims = 1))
    asset_statistics!(portfolio; calc_kurt = false, mu_opt = mu_opt)
    mu2 = portfolio.mu

    @test isapprox(mu1, 3 * vec(mean(portfolio.returns; dims = 1)))
    @test isapprox(mu2, 2 * vec(mean(portfolio.returns; dims = 1)))
end

@testset "Full and Semi Covariance Estimation" begin
    portfolio = Portfolio(; prices = prices)
    asset_statistics!(portfolio; calc_kurt = false)
    mu1 = portfolio.mu
    cov1 = portfolio.cov

    cov_opt = CovOpt(; method = :Full)
    asset_statistics!(portfolio; calc_kurt = false, cov_opt = cov_opt)
    mu2 = portfolio.mu
    cov2 = portfolio.cov

    cov_opt.method = :Semi
    asset_statistics!(portfolio; calc_kurt = false, cov_opt = cov_opt)
    mu3 = portfolio.mu
    cov3 = portfolio.cov

